function getTempData(){document.getElementById("temp-sensor-1").innerHTML="Loading...";document.getElementById("temp-sensor-2").innerHTML="Loading...";var e=new XMLHttpRequest;e.onreadystatechange=function(){if(this.readyState==4&&this.status==200){var t=JSON.parse(e.response);var n=t["temp"];var r=t["humid"];var i=t["last_updated"];var s=document.getElementsByClassName("sensor-info-1")[0];if(i-currentTimeUnix()>=3600){console.log("Data is an hour old.");s.hidden=true}else{console.log("data is up to date");if(s.hidden){s.hidden=false}var o="Temperature: "+n+"&#176;F   "+" Humidity: "+r+"%";document.getElementById("temp-sensor-1").innerHTML=o}}else if(this.readyState==4&&this.status!=200){console.log("error = "+e.response);var u=JSON.parse(e.response);document.getElementById("temp-sensor-1").innerHTML=u[0]}};e.open("GET","/getTemp1");e.send();var t=new XMLHttpRequest;t.onreadystatechange=function(){if(this.readyState==4&&this.status==200){var e=JSON.parse(t.response);var n=e["temp"];var r=e["humid"];var i=e["last_updated"];var s=document.getElementsByClassName("sensor-info-2")[0];if(i-currentTimeUnix()>=3600){console.log("Data is an hour old.");s.hidden=true}else{console.log("data is up to date");if(s.hidden){s.hidden=false}var o="Temperature: "+n+"&#176;F   "+" Humidity: "+r+"%";document.getElementById("temp-sensor-2").innerHTML=o}}else if(this.readyState==4&&this.status!=200){console.log("error = "+t.response);var u=JSON.parse(t.response);document.getElementById("temp-sensor-2").innerHTML=u[0]}};t.open("GET","/getTemp2");t.send()}function getCurrentDate(){var e=new Date;var t=e.getFullYear();var n=e.getMonth()+1;var r=e.getDate();return t+"-"+n+"-"+r}function currentTimeUnix(){return Math.floor((new Date).getTime()/1e3)}getTempData();setInterval(function(){getTempData()},3e5)
